import React, { Component } from 'react'
import {Link} from 'react-router-dom';
import './Header.scss';

export default class Header extends Component {
    render() {
        return (
            <nav className="navbar navbar-expand fixed-top navbar-dark bg-dark">
                <h1 className="navbar-brand" >Someone</h1>

                <div className="navbar-nav" id="navBarContent">
                    <Link className="nav-item nav-link" to="/home" >Firstest</Link>
                            <a className="nav-item nav-link"  href="/">First</a>
                            <a className="nav-item nav-link" href="/">Second</a>
                            <a className="nav-item nav-link" href="/">Third</a>
                </div>
            </nav>
        )
    }
}
